import React from 'react';
import UserTitulo from './user-titulo';
import UserBuscador from './user-buscador';
import UserMenu from './user-menu';

const Sucursal = (props) => {

    //console.log('GLOBAL',props.data.menu)
    const {menu} = props.data

    return (
        <>
        <UserTitulo {...props}/>
        {/* <UserBuscador {...props}/> */}

        {
            menu.length === 0
            ? 
                'aqui no hay nada'

            :

                menu.map((m, i) =>{
                    return <UserMenu    m={m}
                                        {...props}
                                        key={i}
                                        />
                })
        }
        {/* <UserMenu {...props}/> */}

        </>
    );
};

export default Sucursal;
